import React, {Component} from "react"
import {NavLink} from "react-router-dom"
import Airtable from "airtable";
import './style.css'

const base = new Airtable({ apiKey: "keyHHrGcNLiewGh05" }).base(
  "appnnQqeeXZmvVJvB"
);

export default class Conferences extends Component{
    constructor(props){
        super(props)
        this.state={conference:[]}
    }
    componentDidMount() {
        this.name = this.props.name.match.params.id;
        let a = `'${this.name}'`;
        console.log(a);
        base("Imported table")
          .select({
            view: "Grid view",
            filterByFormula: "SEARCH(" + a + ",{Conference ID})",
          })
          .eachPage((records, fetchNextPage) => {
            this.setState({ conference: records });
            fetchNextPage();
          });
      }
      render(){
          console.log(this.state.conference,"hello")
          return(
              <div className="rightbar">
            <table className="table">
            <thead className="thead-dark">
              <tr>

                <th scope="row">Participants Name</th>
                <th scope="row">Email Id</th>
                <th scope="row">Organizer Email</th>
                <th scope="row">Date</th>
              </tr>
            </thead>
            <tbody>  
              {this.state.conference.map((value) => (
                <tr>
                  <td>
                    <NavLink to={`/employee/${value.fields["Participant Identifier"]}`}>
                      {value.fields["Participant Name"]}
                    </NavLink>
                  </td>
                  <td>{value.fields["Participant Identifier"]}</td>
                  <td>{value.fields["Organizer Email"]}</td>
                  <td>{value.fields["Date"]}</td>
                </tr>
              ))}
            </tbody>
          </table>
          </div>
          )
      }
}
